import React from 'react';
import { TextField } from '@mui/material';

const TextInput = ({ value, onChange }) => {
  return (
    <TextField
      label="Write here."
      value={value}
      onChange={onChange}
      fullWidth
      multiline
      rows={4}
    />
  );
};

export default TextInput;
